import classes from "./Projects.module.css";
import initiatives from "../../assets/images/initiatives.png";
import survey from "../../assets/images/survey.png";
import product from "../../assets/images/product.png";

const Projects = () => {
  const projectsList = [
    {
      id: "initiatives",
      name: "Initiatives App",
      image: initiatives,
      description: `Combat tracker suitable for the most played TTRPG game of all times: ${(
        <br />
      )} Dungeons & Dragons`,
      link: "https://bcakko.github.io/initiatives-app/",
    },
    {
      id: "survey",
      name: "Harry Potter Survey From",
      image: survey,
      description: "Survey form about a fantasy novel",
      link: "https://codepen.io/bcakko/pen/LYyJwMb",
    },
    {
      id: "product",
      name: "Product Landing Page",
      image: product,
      description: `Product introducing page about a bass brand`,
      link: "https://codepen.io/bcakko/full/mdmQVxO",
    },
  ];

  const projects = projectsList.map((element) => (
    <div className={classes.flag}>
      <p className={classes.name}>{element.name}</p>
      <a
        href={`${element.link}`}
        target="_blank"
        rel="noreferrer"
      >
        <img src={element.image} alt="combat-tracker-app" />
      </a>
      <p>
        {element.description}
      </p>
    </div>
  ));

  return (
    <div className={classes.projects} id="projects">
      <p>Here are my most recent projects</p>
      <div className={classes.container}>
        {projects}
      </div>
    </div>
  );
};

export default Projects;
